// fe/src/pages/ChooseRegister.js
import React from 'react';
import { Link } from 'react-router-dom';
import './ChooseRegister.css'; // Import the CSS file

const ChooseRegister = () => {
    return (
        <div className="choose-register">
            <h1>Register</h1>
            <p>Please choose your registration type:</p>
            <div className="register-options">
                <Link to="/register/normal" className="register-link">Register as Normal User</Link>
                <Link to="/register/business" className="register-link">Register as Business User</Link>
            </div>
        </div>
    );
};

export default ChooseRegister;
